script: |
  super -f text -I q2352.spq | sort > q2352.out

inputs:
  - name: q2352.spq
    data: |
      SELECT ALL + 76 FROM tab1 (FORMAT parquet) WHERE NOT col1 NOT IN ( + col0, + 56, - - col0 + + col1 * + col2 * + - col0 * + col1 * - col1, - col1 + + 88 );
  - name: tab1

outputs:
  - name: q2352.out
    data: |
